(215, 1, '2018-05-02 09:13:49', '2018-05-02 09:13:49', '<div>\r\n<div>&lt;!DOCTYPE html&gt;</div>\r\n<div>&lt;html&gt;</div>\r\n<div>&lt;head&gt;</div>\r\n<div>&lt;metaname=\"viewport\"content=\"initial-scale=1.0, user-scalable=no\"&gt;</div>\r\n<div>&lt;metacharset=\"utf-8\"&gt;</div>\r\n<div>&lt;title&gt;GoogleMapsTest&lt;/title&gt;</div>\r\n<div>&lt;/head&gt;</div>\r\n<div>&lt;body&gt;</div>\r\n<div>&lt;style&gt;</div>\r\n<div>html, body {</div>\r\n<div>height: 100%;</div>\r\n<div>width: 100%;</div>\r\n<div>}</div>\r\n<div>#map {</div>\r\n<div>height: 50%;</div>\r\n<div>}</div>\r\n<div>#floating-panel {</div>\r\n<div>position: absolute;</div>\r\n<div>top: 10px;</div>\r\n<div>left: 50%;</div>\r\n<div>z-index: 5;</div>\r\n<div>background-color: #fff;</div>\r\n<div>padding: 5px;</div>\r\n<div>border: 1pxsolid#999;</div>\r\n<div>text-align: center;</div>\r\n<div>font-family: \'Roboto\',\'sans-serif\';</div>\r\n<div>line-height: 30px;</div>\r\n<div>padding-left: 10px;</div>\r\n<div>}</div>\r\n<div>&lt;/style&gt;</div>\r\n<div>&lt;divid=\"floating-panel\"&gt;</div>\r\n<div>&lt;b&gt;Start: &lt;/b&gt;</div>\r\n<div>&lt;selectid=\"start\"&gt;</div>\r\n<div>&lt;optionvalue=\"59.9160606,10.7599732\"&gt;Fjerdingen&lt;/option&gt;</div>\r\n<div>&lt;optionvalue=\"59.92334501687682,10.752418041229248\"&gt;Vulkan&lt;/option&gt;</div>\r\n<div>&lt;/select&gt;</div>\r\n<div>&lt;b&gt;End: &lt;/b&gt;</div>\r\n<div>&lt;selectid=\"end\"&gt;</div>\r\n<div>&lt;optionvalue=\"59.9160606,10.7599732\"&gt;Fjerdingen&lt;/option&gt;</div>\r\n<div>&lt;optionvalue=\"59.92334501687682,10.752418041229248\"&gt;Vulkan&lt;/option&gt;</div>\r\n<div>&lt;/select&gt;</div>\r\n<div>&lt;/div&gt;</div>\r\n<div>&lt;divid=\"map\"&gt;&lt;/div&gt;</div>\r\n<div>&lt;script&gt;functioninitMap() {</div>\r\n<div>vardirectionsService = newgoogle.maps.DirectionsService();</div>\r\n<div>vardirectionsDisplay = newgoogle.maps.DirectionsRenderer();</div>\r\n<div></div>\r\n<div>//Map Options</div>\r\n<div>varoptions = {</div>\r\n<div>center:newgoogle.maps.LatLng(59.9160606,10.7599732),</div>\r\n<div>zoom:14</div>\r\n<div>},</div>\r\n<div>element = document.getElementById(\'map\'),</div>\r\n<div>map = newgoogle.maps.Map(element, options);</div>\r\n<div>directionsDisplay.setMap(map);</div>\r\n<div></div>\r\n<div>varonChangeHandler = function() {</div>\r\n<div>calculateAndDisplayRoute(directionsService, directionsDisplay);</div>\r\n<div>};</div>\r\n<div></div>\r\n<div>document.getElementById(\'start\').addEventListener(\'change\', onChangeHandler);</div>\r\n<div>document.getElementById(\'end\').addEventListener(\'change\', onChangeHandler);</div>\r\n<div>}</div>\r\n<div></div>\r\n<div>functioncalculateAndDisplayRoute(directionsService, directionsDisplay) {</div>\r\n<div>directionsService.route({</div>\r\n<div>origin:document.getElementById(\'start\').value,</div>\r\n<div>destination:document.getElementById(\'end\').value,</div>\r\n<div>travelMode:\'DRIVING\'</div>\r\n<div>}, function(response, status) {</div>\r\n<div>if (status === \'OK\') {</div>\r\n<div>directionsDisplay.setDirections(response);</div>\r\n<div>} else {</div>\r\n<div>window.alert(\'Directions request failed due to \' + status);</div>\r\n<div>}</div>\r\n<div>});</div>\r\n<div>}&lt;/script&gt;</div>\r\n<div>&lt;scriptasyncdefer</div>\r\n<div>src=\"https://maps.googleapis.com/maps/api/js?key=AIzaSyDV_mIG20yMqdE1FddkaSUMxlBejEFEW-Y&amp;callback=initMap\"&gt;</div>\r\n<div>&lt;/script&gt;</div>\r\n<div>&lt;/body&gt;</div>\r\n<div>&lt;/html&gt;</div>\r\n</div>', '', '', 'trash', 'closed', 'closed', '', '__trashed', '', '', '2018-05-02 09:13:49', '2018-05-02 09:13:49', '', 0, 'https://tek.westerdals.no/~breale17/wp/?post_type=blocks&#038;p=215', 0, 'blocks', '', 0),
