(265, 1, '2018-05-03 10:42:56', '2018-05-03 10:42:56', '<div>\r\n<div>&lt;!DOCTYPE html&gt;</div>\r\n<div>&lt;html&gt;</div>\r\n<div>&lt;head&gt;</div>\r\n<div>&lt;metaname=\"viewport\"content=\"initial-scale=1.0, user-scalable=no\"&gt;</div>\r\n<div>&lt;metacharset=\"utf-8\"&gt;</div>\r\n<div>&lt;title&gt;GoogleMapsTest&lt;/title&gt;</div>\r\n<div>&lt;/head&gt;</div>\r\n<div>&lt;body&gt;</div>\r\n<div>&lt;style&gt;</div>\r\n<div>html, body, #map {</div>\r\n<div>height: 600px;</div>\r\n<div>width: 500px;</div>\r\n<div>}</div>\r\n<div>#choosingPanel {</div>\r\n<div>position: absolute;</div>\r\n<div>top: 10px;</div>\r\n<div>left: 10px;</div>\r\n<div>z-index: 5;</div>\r\n<div>background-color: #fff;</div>\r\n<div>padding: 5px;</div>\r\n<div>border: 1pxsolid#999;</div>\r\n<div>text-align: center;</div>\r\n<div>font-family: \'Roboto\',\'sans-serif\';</div>\r\n<div>line-height: 30px;</div>\r\n<div>padding-left: 10px;</div>\r\n<div>}</div>\r\n<div>&lt;/style&gt;</div>\r\n<div>&lt;script&gt;</div>\r\n<div>varmap;</div>\r\n<div>varcurrentPosMark;</div>\r\n<div>varstartingPoint;</div>\r\n<div>vardestination;</div>\r\n<div>vartravelType;</div>\r\n<div>/*</div>\r\n<div>var fjerdingen = {lat: 59.9160606, lng: 10.7599732};</div>\r\n<div>var brenneriveien = {lat: 59.9201627, lng: 10.7506793};</div>\r\n<div>var vulkan = {lat: 59.9231527, lng: 10.7516181};</div>\r\n<div>var kirkegata = {lat: 59.9111719, lng: 10.742772};</div>\r\n<div>*/</div>\r\n<div>vardirectionsService;</div>\r\n<div>vardirectionsDisplay;</div>\r\n<div>varicon = \'https://developers.google.com/maps/documentation/javascript/examples/full/images/beachflag.png\';</div>\r\n<div>functioninitMap() {</div>\r\n<div>varcampusLocation = {</div>\r\n<div>fjerdingen: {</div>\r\n<div>lat:59.9160546,</div>\r\n<div>lng:10.7586542</div>\r\n<div>},</div>\r\n<div>brenneriveien: {</div>\r\n<div>lat:59.9201627,</div>\r\n<div>lng:10.7506793</div>\r\n<div>},</div>\r\n<div>vulkan: {</div>\r\n<div>lat:59.9231527,</div>\r\n<div>lng:10.7516181</div>\r\n<div>},</div>\r\n<div>kirkegata: {</div>\r\n<div>lat:59.9111719,</div>\r\n<div>lng:10.742772</div>\r\n<div>},</div>\r\n<div>};</div>\r\n<div>vartravelTypes = {</div>\r\n<div>driving:\'DRIVING\',</div>\r\n<div>walking:\'WALKING\'</div>\r\n<div>}</div>\r\n<div>this.directionsService = newgoogle.maps.DirectionsService();</div>\r\n<div>this.directionsDisplay = newgoogle.maps.DirectionsRenderer();</div>\r\n<div>//Map Options</div>\r\n<div>this.startingPoint = campusLocation[getAllUrlParams().origin];</div>\r\n<div>this.destination = campusLocation[getAllUrlParams().destination];</div>\r\n<div>this.travelType = travelTypes[getAllUrlParams().transporttype];</div>\r\n<div>console.log(getAllUrlParams());</div>\r\n<div>this.map = newgoogle.maps.Map(document.getElementById(\'map\'), {</div>\r\n<div>center:this.startingPoint,</div>\r\n<div>mapTypeId:google.maps.MapTypeId.ROADMAP,</div>\r\n<div>zoom:18</div>\r\n<div>});</div>\r\n<div>console.log(this.startingPoint);</div>\r\n<div>console.log(this.destination);</div>\r\n<div>console.log(this.travelType);</div>\r\n<div>calculateAndDisplayRoute(this.directionsService, this.directionsDisplay)</div>\r\n<div>directionsDisplay.setMap(this.map);</div>\r\n<div>};</div>\r\n<div>functiongetAllUrlParams(url) {</div>\r\n<div>// get query string from url (optional) or window</div>\r\n<div>varqueryString = url ? url.split(\'?\')[1] : window.location.search.slice(1);</div>\r\n<div>// we\'ll store the parameters here</div>\r\n<div>varobj = {};</div>\r\n<div>// if query string exists</div>\r\n<div>if (queryString) {</div>\r\n<div>// stuff after # is not part of query string, so get rid of it</div>\r\n<div>queryString = queryString.split(\'#\')[0];</div>\r\n<div>// split our query string into its component parts</div>\r\n<div>vararr = queryString.split(\'&amp;\');</div>\r\n<div>for (vari=0; i&lt;arr.length; i++) {</div>\r\n<div>// separate the keys and the values</div>\r\n<div>vara = arr[i].split(\'=\');</div>\r\n<div>// in case params look like: list[]=thing1&amp;list[]=thing2</div>\r\n<div>varparamNum = undefined;</div>\r\n<div>varparamName = a[0].replace(/\\[\\d*\\]/, function(v) {</div>\r\n<div>paramNum = v.slice(1,-1);</div>\r\n<div>return\'\';</div>\r\n<div>});</div>\r\n<div>// set parameter value (use \'true\' if empty)</div>\r\n<div>varparamValue = typeof(a[1])===\'undefined\' ? true : a[1];</div>\r\n<div>// (optional) keep case consistent</div>\r\n<div>paramName = paramName.toLowerCase();</div>\r\n<div>paramValue = paramValue.toLowerCase();</div>\r\n<div>// if parameter name already exists</div>\r\n<div>if (obj[paramName]) {</div>\r\n<div>// convert value to array (if still string)</div>\r\n<div>if (typeofobj[paramName] === \'string\') {</div>\r\n<div>obj[paramName] = [obj[paramName]];</div>\r\n<div>}</div>\r\n<div>// if no array index number specified...</div>\r\n<div>if (typeofparamNum === \'undefined\') {</div>\r\n<div>// put the value on the end of the array</div>\r\n<div>obj[paramName].push(paramValue);</div>\r\n<div>}</div>\r\n<div>// if array index number specified...</div>\r\n<div>else {</div>\r\n<div>// put the value at that index number</div>\r\n<div>obj[paramName][paramNum] = paramValue;</div>\r\n<div>}</div>\r\n<div>}</div>\r\n<div>// if param name doesn\'t exist yet, set it</div>\r\n<div>else {</div>\r\n<div>obj[paramName] = paramValue;</div>\r\n<div>}</div>\r\n<div>}</div>\r\n<div>}</div>\r\n<div>return obj;</div>\r\n<div>}</div>\r\n<div>functiongetGeoLocation(){</div>\r\n<div>//Getting current position</div>\r\n<div>if (navigator.geolocation) {</div>\r\n<div>navigator.geolocation.getCurrentPosition(function(position) {</div>\r\n<div>varpos = {</div>\r\n<div>lat:position.coords.latitude,</div>\r\n<div>lng:position.coords.longitude</div>\r\n<div>};</div>\r\n<div>this.currentPosMark = newgoogle.maps.Marker({</div>\r\n<div>position:pos,</div>\r\n<div>map:this.map,</div>\r\n<div>icon:this.icon,</div>\r\n<div>title:\'You are here!\'</div>\r\n<div>});</div>\r\n<div>map.setCenter(pos);</div>\r\n<div>}, function() {</div>\r\n<div>handleLocationError(true, infoWindow, this.map.getCenter());</div>\r\n<div>});</div>\r\n<div>} else {</div>\r\n<div>// Browser doesn\'t support Geolocation</div>\r\n<div>handleLocationError(false, infoWindow, this.map.getCenter());</div>\r\n<div>}</div>\r\n<div>}</div>\r\n<div>functionhandleLocationError(browserHasGeolocation, infoWindow, pos) {</div>\r\n<div>infoWindow.setPosition(pos);</div>\r\n<div>infoWindow.setContent(browserHasGeolocation ?</div>\r\n<div>\'Error: The Geolocation service failed.\' :</div>\r\n<div>\'Error: Your browser doesn\\\'t support geolocation.\');</div>\r\n<div>infoWindow.open(map);</div>\r\n<div>}</div>\r\n<div>/*</div>\r\n<div>function setDestination(koordinates){</div>\r\n<div>this.destination = koordinates;</div>\r\n<div>calculateAndDisplayRoute(directionsService, directionsDisplay);</div>\r\n<div>}</div>\r\n<div>*/</div>\r\n<div>functioncalculateAndDisplayRoute(directionsService, directionsDisplay) {</div>\r\n<div>directionsService.route({</div>\r\n<div>origin:this.startingPoint,</div>\r\n<div>destination:this.destination,</div>\r\n<div>travelMode:this.travelType,</div>\r\n<div>unitSystem:google.maps.UnitSystem.METRIC</div>\r\n<div>}, function(response, status) {</div>\r\n<div>if (status === \'OK\') {</div>\r\n<div>directionsDisplay.setDirections(response);</div>\r\n<div>} else {</div>\r\n<div>window.alert(\'Directions request failed due to \' + status);</div>\r\n<div>}</div>\r\n<div>});</div>\r\n<div>}&lt;/script&gt;</div>\r\n<div>&lt;divid=\"choosingPanel\"&gt;</div>\r\n<div>&lt;divid\"getPos\"&gt;</div>\r\n<div>&lt;buttontype=\"button\"class=\"btn\"</div>\r\n<div>onclick=\"getGeoLocation()\"&gt;Where am i?&lt;/button&gt;</div>\r\n<div>&lt;/div&gt;</div>\r\n<div>&lt;divid=\"map\"&gt;&lt;/div&gt;</div>\r\n<div>&lt;scriptasyncdefer</div>\r\n<div>src=\"https://maps.googleapis.com/maps/api/js?key=AIzaSyDV_mIG20yMqdE1FddkaSUMxlBejEFEW-Y&amp;callback=initMap\"&gt;</div>\r\n<div>&lt;/script&gt;</div>\r\n<div>&lt;/body&gt;</div>\r\n<div>&lt;/html&gt;</div>\r\n</div>', '', '', 'trash', 'closed', 'closed', '', '__trashed-2', '', '', '2018-05-03 10:42:56', '2018-05-03 10:42:56', '', 0, 'https://tek.westerdals.no/~breale17/wp/?post_type=blocks&#038;p=265', 0, 'blocks', '', 0);
